create or replace trigger "Manufacturer_Insert"
before insert on AAMANUFACTURER
for each row
begin
if :new.ID is null then
select ManufacturerID.NextVal into :new.ID from dual;
end if;
end;
/
alter trigger "Manufacturer_Insert" enable;

